import Form from "../components/form";

export default function AddEditMovie() {
  const initValues = {
    title: "",
    releaseDate: "",
    runtime: "",
    mpaaRating: "",
    rating: "",
    description: "",
  };
  return (
    <section className="hero">
      <div className="hero-body">
        <p className="title">Add/Edit Movie</p>
        <div className="content">
          <Form initValues={initValues} />
        </div>
      </div>
    </section>
  );
}
